column8:
装着感抜群のカナル型イヤホン！<br>
重低音から高音までバランスのある音質！<br>
<br>
軽量なイヤホンで快適な装着感を実現！<br>
重低音から高音までバランスのある音質を実現！<br>
<br>
高級感のあるメタルボディのイヤホン！<br>
装着感も抜群で長時間の使用にも向いています！<br>
<br>
デザイン性がよくイヤホンの外側にはアルミを使用しており高級感があります。<br>
直接耳に触れる部分は樹脂製になっており、装着感も抜群です。<br>
<br>
イヤホンにリモコン搭載！音楽の再生などの操作が可能！<br>
<br>
イヤホンのケーブルの途中にリモコンが付いており、<br>
ボタンを押すことで音楽の再生や停止などを行えます。<br>
<br>
マイクも内蔵しているのでイヤホンを装着したままでも通話できます。<br>
AndroidスマホとiPhoneに対応しており、切り替えることで使用できます。<br>
<br>
ユニットサイズ：10mm<br>
インピーダンス：32Ω<br>
再生周波数帯域：20-20000hz<br>
感度：95+3db<br>
プラグ：3.5mm 4極ステレオミニ<br>
ケーブル長さ：約120cm<br>
カラー：シルバー、ゴールド、レッド、ブラック<br>
製造国：中国<br>
<br>
※一部スマートフォンでは音量ボタン等が反応しない場合が御座います。<br>
※こちらの商品はメール便発送にて送料無料です。<br>
※ゆうメールでの発送は（ポスト投函）代金引換、日付指定はできませんのでご了承ください。<br>
