臨場感のあるゲーミング!!高性能な3.5mm接続ヘッドセット！<br>
<br>
高精度な50mmドライバーを採用しているので、臨場感のある音で様々な<br>
ゲームを楽しめます。<br>
<br>
ゲームだけではなく映画や音楽・Skype等を快適に楽しむこともできます。<br>
<br>
パソコンに簡単に接続できる！3.5mm接続で端子に挿すだけ！<br>
<br>
パソコンに接続する際は、インストールドライバーが必要なく、パソコンの<br>
イヤホン端子とマイク端子に挿すだけで簡単に音楽の再生ができます。<br>
<br>
LED端子はLEDライトに電力を供給するために使用します。<br>
<br>
ボリュームコントロール搭載！音量の調整を簡単に調整できる！<br>
<br>
ボリュームコントロールを搭載しており、手元で簡単に音量の調整ができます。<br>
また、マイクミュートの操作もコントロール手元で操作できます。<br>
<br>
マイク搭載でSkype等で通話可能！約120度回転するので口元に近づけれる！<br>
マイク部分は約120度回転するので口元に近づけて会話できます。<br>
<br>
USB端子を接続するだけ！LEDライトが点灯して格好良く光る！<br>
USB端子をパソコンのUSBポートに挿すとヘッドホンとマイク先端のサイドが光ります。<br>
<br>
ドライバ直径：50mm<br>
インピーダンス：32Ohm<br>
感度：108dB +/-3dB<br>
周波数範囲：20Hz-20KHz<br>
マイクサイズ：6.0mm×5.0mm<br>
マイク感度：-34dB +/-3dB<br>
マイクインピーダンス：2.2KOhm<br>
ケーブル長さ(約)：2.1m<br>
LED動作電圧：DC5V<br>
インターフェイス：3.5mm + USB(LEDライト用)<br>
ヘッドホンサイズ(約)：21×11.5×21.5cm<br>
ヘッドホン重さ(約)：379g<br>
製造国：中国<br>
<br>
