ウォーキングなどのスポーツに最適！<br>
フィット感抜群で外れにくく使いやすい！<br>
<br>
耳から外れにくい形状でウォーキングから動きの激しいトレーニングまで<br>
快適に音楽を楽しむことができます。<br>
<br>
リモコン付きで音楽の再生/停止ができる！<br>
スマホで通話できるマイク内蔵！<br>
<br>
ケーブルに付いているリモコンでスマホを取り出さずに音楽の再生や停止が可能！<br>
マイクも内蔵しているのでイヤホンを装着したまま通話をすることもできます。<br>
<br>
フィット感抜群で耳への負担が少なく長時間の使用でも快適な装着感！<br>
<br>
耳から外れにくい形状をしており、ネック部分は回転するので<br>
最適なボジションでイヤホンを使用することができます。<br>
<br>
イヤホンの背面は反射板になっており夜間のジョギングなどに最適です！<br>
<br>
イヤホンの背面の一部は反射板になっており、夜間のジョギングに便利です。<br>
<br>
インピーダンス：16Ω±15%<br>
再生周波数帯域：20-20000Hz<br>
ドライバー：10mm<br>
最大入力：5mW<br>
プラグ：3.5mm 4極ステレオミニプラグ(L型)<br>
ケーブル長さ：約1.2m<br>
重量：約25g<br>
製造国：中国<br>
<br>
