通話や音楽再生に対応したBluetoothヘッドセット<br>
<br>
ビジネスシーンや周りの状況に気を配りながら作業時には片耳で<br>
通話をしながらメモを取ったり、PC入力するのにも重宝します。<br>
<br>
不意に話しかけられた際もスマートに対応できます。<br>
<br>
両耳に対応しているので音楽を聞いたりプライベートな時間を楽しみ<br>
たい時は両耳で音楽を楽しめます。<br>
<br>
どんな場所でも手ぶらで音声に集中できるのが魅力的です。<br>
※イヤホンはアナログ出力です。<br>
<br>
本体にバッテリー残量が表示されるので、バッテリーが切れる<br>
前に充電することが出来ます。<br>
<br>
Bluetooth：ver4.1 specification<br>
対応プロファイル：A2DP v1.3/AVRCP v1.6/HFP v1.6/HSP v1.2/DI v1.3<br>
充電時間(約)：2時間<br>
連続通話時間(約)：21時間<br>
連続再生時間(約)：15時間<br>
待機時間(約)：40日<br>
通信距離(約)：8～10m<br>
サイズ(約)：W80mm×D35mm×155mm<br>
